(CNN) -- 시리아 안보군에게 유인되어 활동가 형제의 항복을 유도하려고 끌려간 젊은 여성이 베거와 해체된 채 발견됐다는 보고서가 활동가들과 인권단체들로부터 전해졌다. 이번 사건은 이번 국가 내 전쟁으로 인한 잔인행위의 또 다른 대표적인 사례이다. 작년 9월, 19세의 자이나브 알후스니(Zainab Alhusni)는 그녀의 집에서 식료품을 구매하기 위해 나갔으나, 그녀의 가족은 안전군에 의해 그녀를 다시 볼 수 없었다. 반대파 활동가 단체와 국제앰네스티는 CNN과 함께 안전군에 의해 해체된 시신으로 돌아온 것을 확인하였다. 호믹스(Homs) 지역에서 고통받던 보고서들로 인하여 세계 각지에서 분노를 일으켰으며, 수십 명의 여성들이 죽음에 대한 시위를 벌였다.
@highlight
"그들은 장미 자이나브(Zainab)을 죽였다" 시위대의 플래카드에 적혀있다.
@highlight
유엔은 자이나브 알후스니의 죽음을 "끔찍한 일"이라고 말한다.
@highlight
많은 사람들은 그녀가 형제를 찾기 위해 잡혀갔다고 주장한다.
시리아 당국은 이 사건에 대해 언급하지 않았다.

"@placeholder"는 무엇일까요? Amnesty International, CNN, Homs, Syria, Syrian, United Nations, Zainab Alhusni, rose Zainab 중에서 선택하세요.

